/** @lucene.experimental  */
public ValueFiller getValueFiller() {
  return new ValueFiller() {
    private final MutableValueFloat mval = new MutableValueFloat();

    @Override
    public MutableValue getValue() {
      return mval;
    }

    @Override
    public void fillValue(int doc) {
      mval.value = floatVal(doc);
    }
  };
}

